cM(21,"Nettles","Unlocked a new crop: nettle. Nettle boosts mushrooms it touches orthogonally, but hurts flowers and berries.","Unlocked a new crop: nettle. Nettle boosts mushrooms it touches orthogonally, but hurts flowers and berries. The mushroom boost increases spore production without increasing seeds consumption. The boost is an additional multiplier independent from flower boost to mushroom, so having both a nettle and a flower works even better.",mf[4],"<br><br>The image shows a possible configuration where the mushroom receives boost from both nettle (top) and flower (bottom). The top left flower and top right blackberry in this image however are negatively affected by the nettle.",
[[ze[4],mf[4],ie[4]],[je[4],He[4],je[4]],[Ae[4],Ae[4],Ae[4]]]);cM(6,"Tree leveled up","Tree leveled up","Thanks to spores, the tree completely rejuvenated and is now a "+Rh[zv(1)][0]+", level 1. More spores will level up the tree more. The tree can unlock abilities and more at higher levels. Click the tree in the field for more info.",void 0,void 0,[[void 0,Rh[zv(1)][1][0]],[void 0,Rh[zv(1)][2][0]]]);
cM(12,"Sun ability","Tree reached level 2 and discovered sun ability","The tree reached level 2 and discovered the sun ability!<br><br>"+Gk[zk].description,md);cM(14,"Mist ability","Tree reached level 4 and discovered mist ability","The tree reached level 4 and discovered the mist ability! You now have multiple abilities, only one ability can be active at the same time.<br><br>"+Gk[Bk].description,ld);
cM(15,"Rainbow ability","Tree reached level 6 and discovered rainbow ability","The tree reached level 6 and discovered the rainbow ability!<br><br>"+Gk[Dk].description,nd);
cM(2,"Tree dropped fruit","Tree reached level 5 and dropped a fruit",'The tree reached level 5 and dropped a fruit! Fruits provide boosts and can be upgraded with fruit essence. Essence is gained by sacrificing fruits, and the full amount of fruit essence can be used for upgrading all other fruits at the same time. See the "fruit" tab, it also has a more extensive help dialog for fruits.<br><br>A possible strategy: keep fruits with good abilities you like. Sacrifice any other surplus fruits, so you can use the essence to upgrade the good fruits.',rd[0]);
cM(18,"Tree dropped better fruit","Tree reached level 15 and dropped another fruit","The tree reached level 15 and dropped another fruit! It drops one every 5 levels. Fruits from higher tree levels have random probability to be of better, higher tier, types.",rd[1]);
cM(7,"Tree can transcend","Tree reached level 10 and it's now possible to transcend","The tree reached adulthood at level 10, and is now able to transcend! Click the tree in the field to view the transcension dialog.<br><br>Transcension will restart the basic field from the beginning, but will unlock a new type of field and a new type of upgrades. You can choose to transcend now, or level the tree a bit more first and transcend later.<br><br> The tree also dropped another fruit, check the fruit tab whether you want to keep it since it's in the sacrificial pool for now.",void 0,
void 0,[[void 0,Rh[zv(10)][1][0]],[void 0,Rh[zv(10)][2][0]]]);
cM(1,"Transcension","You performed your first transcension! You can use resin in the ethereal field tab.","You performed your first transcension! Check the new ethereal field tab, spend resin on ethereal plants for bonuses to your basic field. Get more resin by transcending again.",void 0,"<br><br>The following image shows an example of an ethereal field setup with several ethereal crops that give boosts to the main field: all types of basic field berries, mushrooms and flowers are boosted by this example, and runs start with starting seeds from the fern. The image also shows a white lotus that boosts the neighboring ethereal crops to make their boosts even bigger.",[[Of[4],
ze[4],void 0],[ie[4],wf[4],He[4]],[void 0,ie[4],void 0]]);cM(9,"Ethereal upgrades","You unlocked your first ethereal upgrade!",'You unlocked your first ethereal upgrade, thanks to planting an ethereal crop! Check the new "ethereal upgrades" tab to view this new type of upgrade. Ethereal upgrades cost resin, just like ethereal plants do, but ethereal upgrades are permanent and non-refundable, unlike ethereal crops which can be deleted give 100% refund');
cM(17,"Mistletoes","Unlocked a new crop: mistletoe","Unlocked a new crop: mistletoe. Mistletoe can be placed next to the basic field tree to create twigs, orthogonally, not diagonally. They produce twigs, which, like resin, you only actually get when transcending. Twigs help the ethereal field tree. However having more than one mistletoe increases the spore requirement for leveling the basic tree and slightly decreases resin gain, and more mistletoes give diminishing returns (but still increases it). Mistletoes that are not planted next to the tree do nothing at all.",
Hf[4],"<br><br>The image shows a possible configuration where mistletoes are next to the tree and thus give twigs on tree level up.",[[Rh[zv(2)][1][0],Hf[4]],[Rh[zv(2)][2][0],Hf[4]]]);
cM(22,"Ethereal tree leveled up","The ethereal tree leveled up, unlocking new ethereal upgrades, crops and boosts","Thanks to twigs, the ethereal tree leveled up! This is the tree in the ethereal field, not the one in the basic field. Leveling up the ethereal tree unlocks new ethereal crops and/or upgrades, depending on the level. Each level also provides a resin production boost to the basic tree.",void 0,void 0,[[void 0,Rh[zv(1)][1][4]],[void 0,Rh[zv(1)][2][4]]]);
cM(24,"Challenges","You unlocked a challenge!","You unlocked a challenge! Challenges can be accessed from the tree, as an alternative to regular transcension. All challenges give a production bonus (to seeds and spores, and a smaller amount to resin and twigs) for highest tree level reached. Challenges may also give one-time rewards for successfully reaching a certain level. Challenges can be ran as many times as desired, redoing them can increase the max level reached.",void 0);
cM(25,"Bee challenge",void 0,"You started the bee challenge! Rules are different from the standard game. You can click the tree at any time to view the current challenge rules, reward and stats. Plant some watercress or blackberry to get started.",Mf[4],"<br><br>The image below shows a possible configuration for the bees: all workers touch a flower as required, drones touch workers for extra boost (so bees provide a boost-boost), and queens touch drones to make that boost stronger (a boost-boost-boost). More than 1 flower does not increase boost but multiple drones or queens do. The rightmost worker bee gives most boost because it touches 3 drones, and the topmost drone gives least boost since it touches the least queens. You can fill in gaps in the picture where more drones or queens would increase the boost more. Not shown in the picture is that you also need some mushroom and berry production running somewhere, which can also be boosted by flowers in the standard way.",
[[void 0,Kf[4],Lf[4],Mf[4]],[Kf[4],Nf[4],Kf[4],Lf[4]],[void 0,Kf[4],Lf[4],Mf[4]],[void 0,Lf[4],Mf[4],void 0]]);cM(26,"Challenge completed","","The tree reached the challenge's target level, you can successfully complete the challenge and can get its main reward! You can complete the challenge from the tree dialog, or continue to reach a higher level for more challenge max-level bonus. You can also replay the challenge at any later time to increase the max level.",void 0);
cM(27,"Bees","You unlocked bees!","You unlocked bees! Bees boost orthogonally neighboring flowers (in spring also diagonally), while flowers boost berries and mushrooms (so bees are a boost of a boost). This adds a new independent multiplier that can be upgraded to the game.",If[4],"<br><br>The image shows a possible configuration for bees, such that the bees boost flowers, which in turn boost berries and mushrooms. It's ensured both the mushroom and the berry it consumes from have a bee-boosted flower.",
[[void 0,oe[4],Ce[4],oe[4]],[oe[4],Ce[4],If[4],Ce[4]],[void 0,oe[4],Ce[4],oe[4]],[void 0,If[4],Ce[4],Me[4]]]);
cM(28,"Automaton & Blueprints","You unlocked the automaton!","You unlocked the automaton! You can place the automaton in the ethereal field. When placed, it gives a boost to neighbors, and the automaton tab and blueprints unlock, allowing to automate various parts of the game.<br><br>You must place the automaton in the ethereal field before this works, then go to the new automaton tab, and configure its settings before it actually automates anything.<br><br>More and more automation features become available later in the game.<br><br>When removing the automaton from the ethereal field, most automation features will be disabled, but they all come back the way they were when placing the automaton again.<br><br>The automaton initially has the following features unlocked:<br><br> \u2022 Blueprints and templates: Templates are translucent blue looking versions of crops that can be placed in the field using the regular planting menu. Blueprints can be created and placed from the blueprint button in the tree.<br> \u2022 Auto-plant: the automaton will automatically plant crops according to a blueprint, and plant higher tiers once you unlock those tiers.<br> \u2022 Buttons to delete all crops in the main field or in the ethereal field: these are in the automaton tab and are for convenience. Deleting the ethereal field still uses tokens as usual.<br> \u2022 Neighbor boost in the ethereal field: the automaton in the ethereal field gives an independent boost to neighbors, similar to lotuses.<br>",Uf[4],
void 0,[[void 0,Qg[4],void 0],[Qg[4],Ig[4],Qg[4]],[void 0,Qg[4],void 0]]);
cM(29,"Auto upgrades","You unlocked auto upgrades!","You unlocked auto-upgrades for the automaton! See the automaton tab. You can enable or disable auto-upgrades, and choose a max cost the automaton is allowed to spend.<br><br>All basic upgrades that boost crops will be automatically performed by the automaton, at their normal cost, when enabled.<br><br>In addition, you can automate the choice upgrades, but you must configure which choice for which upgrade you prefer in the automaton settings first.",Uf[4]);
cM(30,"Auto upgrades more options","You unlocked more auto upgrade options!",'You unlocked more finetuning options for the auto upgrades. See the automaton tab in the dialogs behind the "gear": you can now configure the max cost per crop type (berry, mushroom, flower, ...).',Uf[4]);
cM(31,"Auto plant","You unlocked auto plant!","You unlocked auto-planting for the automaton! See the automaton tab. You can enable or disable auto-plant, and choose a max cost the automaton is allowed to spend.<br><br>How this works: the automaton will replace existing crops or blueprint templates with a higher tier, if that higher tier is unlocked. The automaton will not plant new crops from scratch, and will only replace crops or blueprint templates of the same type, e.g. berry to berry, flower to flower, ...<br><br>For example: If you have a blackberry, and now unlock blueberry, the automaton will automatically replace all planted blackberries in the field with blueberries, given enough resources.",Uf[4]);
cM(32,"Auto plant more options","You unlocked auto plant more options!",'You unlocked more finetuning options for auto planting, you can now choose how many resources the automaton can spend on crops of each type. Use the "gear" button next to the auto-plant button to finetune these options',Uf[4]);
cM(33,"Auto unlock","You unlocked auto-unlock!","You unlocked auto-unlock. This will unlock the next tiers of crops automatically. Combined with auto-plant and blueprint templates, this can almost fully automate a run.<br><br>Once you planted the general shape of your field with cheap crops or blueprint templates, everything will happen automatically from then on. Just place berries, mushrooms, flowers, nettles and bees once to indicate the layout.<br><br>Tip: ensure there are some berries that don't touch a mushroom, because if a mushroom consumes all seeds of a berry, income will stop and the automaton won't get resources for further upgrades and planting, resulting in a deadlock.",Uf[4]);
cM(34,"Multiplicity","You unlocked multiplicity! Mushrooms and berries boost each other no matter at what location.","You unlocked multiplicity! Berries now boost other berries just by having multiple anywhere field, and similarly, mushrooms boost mushrooms. This works across tiers, but max 1 tier higher or lower (e.g. blackberry affects blueberry, but it won't affect the 2-higher tier cranberry). For example, if there are 4 berry plants anywhere in the field, each berry receives a boost from the three others. Crops that are growing already fully count for multiplicity.",
ie[4],void 0,[[ie[4],void 0,je[4]],[void 0,void 0,void 0],[je[4],void 0,ie[4]]]);
cM(35,"Squirrel & Nuts","You unlocked the squirrel and the nuts crops!",'You unlocked the squirrel and the nuts crops! The squirrel gives an entirely new tech tree of ugrades. Place a squirrel in the ethereal field (it\'ll also boost neighbors!). Grow nuts in the main field using the new nuts crops. Use nuts to buy squirrel upgrades, in the new squirrel tab.\n    <br><br>\n    Nuts crops unlock at tree level 45, the first one is Almond. You can have max 1 nut crop in the main field, but it can be upgraded and replaced with better types. Nuts crops benefit from flowers, but only in a limited form independent of flower upgrades or bees, nuts crops are not affected by the same boosts as berries or mushrooms, they have their own more limited boosts. Watercress can copy from nuts, but only at half effectiveness and without fruit bonus. Nuts are negatively affected by winter if not next to tree, just like most crops.\n    <br><br>\n    Buy squirrel upgrades in the squirrel tab. Squirrel upgrades are laid out in a tech tree. Each next squirrel upgrade costs exponentially more than the previous one, no matter what order you do them in. Get higher tree levels and nut crops to get enough nuts for the next one.\n    <br><br>\n    You can respec the squirrel upgrades if you regret a decision, using a respec token. You get a few for free, more can be gotten for amber in the amber tab.\n    <br><br>\n    After you respec squirrel upgrades at least once, the "buy all to here" option unlocks for upgrades you have seen before: click the upgrade icon of any squirrel upgrade further down in the tree, then use this button to automatically buy this upgrade and all squirrel upgrades required to reach this one (including all of gated stages), if you can afford it. This avoid having to click every individual upgrade again after respec.\n    <br><br>\n    Planting and upgrading nuts crops cost spores instead of seeds. They work with automaton just like most other crops. If the automaton is spending too much spores on nuts upgrades and you want the tree to level up instead, decrease the allowed % setting for nuts upgrades in the automaton settings.\n    ',Vf[4],
void 0,[[te[4],Ee[4],te[4]],[Ee[4],Se[4],pf[4]],[te[4],Ee[4],te[4]]]);
cM(36,"Amber","The tree dropped amber!","The tree dropped a piece of amber! From now on, every now and then, the tree can drop amber when it levels up.\n    <br><br>\n    Amber can be used in the new amber tab for various effects.\n    <br><br>\n    Effects:\n    <br>\n    \u2022 Production boost 100%: gives a 100% boost to berries and mushrooms for the entire run, this lasts until next transcension.\n    <br>\n    \u2022 Season hold this run: Keep the current season until transcension, it won't change until the run is done. Ending the run will start the next season with 24 hours left. If the run is finished early (current season didn't need to be held), it'll give a full refund of the amber cost and no seasons are affected.\n    <br>\n    \u2022 Season +1h: Make the current season 1 hour longer (1-time). Can be used once per season.\n    <br>\n    \u2022 Season -1h: Make the current season 1 hour shorter (1-time). If the season has less than 1 hour remaining, then it is only shortened by this remaining time, immediately activating the next season. Can be used once per season.\n    <br>\n    \u2022 Reset choice upgrades: Resets all choice upgrades, this can be used once per run and allows choosing each one again manually.\n    <br>\n    \u2022 More unlock later\n    ",void 0,
void 0,void 0);
cM(37,"Combined Seasonal Fruits","You unlocked combined seasonal fruits fusing!","You unlocked fusing of multi-season fruits! Now when you fuse fruits of different seasons, they may form a new fruit that gives the bonus for both seasons. The following combinations work:\n    <br><br>\n    \u2022 Apricot + Pineapple = Mango (spring + summer)\n    <br>\n    \u2022 Pineapple + Pear = Plum (summer + autumn)\n    <br>\n    \u2022 Pear + Medlar = Quince (autumn + winter)\n    <br>\n    \u2022 Medlar + Apricot = Kumquat (winter + spring)\n    <br><br>\n    Other combinations (e.g. Apricot + Pear, or Quince + Plum) don't work and just give a regular apple, or a lowest common denominator seasonal fruit.\n    <br><br>\n    To get these multi-season fruits, fuse fruits as you usually do. All other fusing rules, such as the combining of abilities (and inability to fuse in case of full ability mismatches), work as usual, the change is now some mixed combinations give a new improved multi-season fruit rather than an apple.\n    <br><br>\n    Later, if (and only if) you get the second fruit-mixing squirrel upgrade, you additionally get the following combinations to make the 4-seasons star fruit:\n    <br><br>\n    \u2022 Mango + Quince = Star Fruit (4 seasons)\n    <br>\n    \u2022 Plum + Kumquat = Star Fruit (4 seasons)\n    <br><br>\n    Combinations that don't cover all 4 seasons, such as mango+plum, won't work, it must be one of the combinations listed above.\n    <br><br>\n    Remember, star fruit fusing is not yet available if you just unlocked the first fruit mixing upgrade now, the star fruit requires the second such squirrel upgrade. Now you already know how to prepare for it though.\n    ",rd[8],
void 0,[[sd[1],td[1],ud[8]],[vd[1],wd[4],xd[7]],[yd[4],zd[1],Ad[9]]]);cM(38,"Auto prestige","You unlocked auto prestige!","You unlocked auto-prestige for the automaton! This is integrated with auto-unlock: the same cost settings of auto-unlock are used for auto-prestige, and you can use a toggle to enable/disable auto-prestige in the auto-unlock settings.",Uf[4]);cM(39,"Squirrel evolution","Squirrel evolution",function(){return tx()},Qd);
cM(40,"Auto action","You unlocked auto actions by the automaton!","You unlocked auto actions by the automaton! This lets the automaton override the field with another blueprint and/or pick a fruit after a chosen trigger, such as tree level, unlocked crop or time.<br><br>You must enable and configure this feature in the automaton tab before it works, using the auto-action toggle and configuration buttons. You must configure both a trigger, and the action(s), and set buttons and checkboxes to enabled.<br><br>\nThe automatic blueprint is useful to get a different layout later in the run than at the start of the run. You choose your starting blueprint as usual at the start of the run, the automaton will override with the chosen one. You can also choose a fruit to match.\n<br><br>\nDuring some challenges you may want this disabled, toggle it off in the automaton tab in this case.\n",
Uf[4]);
cM(41,"Ethereal mistletoe","You got the ethereal mistletoe!","You got the ethereal mistletoe!\n    <br><br>\n    This crop has more effect the more you upgrade it. Upgrades cost time, and most don't cost other resources except some with other costs that unlock later.\n    <br><br>\n    The evolve upgrade will unlock new upgrades at certain levels, and also gives a boost to the effects of all other upgrades at the same time. The first such upgrade unlocks after the first evolve, the next only at the third evolve, and more follow after that. Evolve does not reset current upgrades, they keep existing at their level and can still be leveled up as normal.\n    <br><br>\n    The ethereal mistletoe must be planted orthogonally (not diagonally) next to the ethereal tree, otherwise none of its effects work and its upgrades don't progress.\n    <br><br>\n    Similar to squirrel and automaton, the ethereal mistletoe can give a boost to neighbors in the ethereal field, but this ability is unlocked only by later upgrades.\n    <br><br>\n    You can only have one upgrade in progress at the same time. You can always freely stop an upgrade. This pauses the upgrade, it remembers the time spent so far. You can do any other upgrade during this time. Any other resources are also paid back during pause.\n    <br><br>\n    If the mistletoe is sitting idle and not doing any upgrades, unused idle time is accumulated. Unused idle time will speed up active upgrades by 2x, so unused time is not lost. The mistletoe must still be correctly planted for idle time to accumulate.\n    ",Hf[4],
void 0,[[Rh[zv(15)][1][4],Hf[4]],[Rh[zv(15)][2][4],void 0]]);
cM(42,"Infinity field","You unlocked the infinity field!","You unlocked the infinity field!\n    <br><br>\n    The infinity field is a new field in a new tab, in which you can plant infinity crops. Infinity crops produce infinity seeds, which allow planting more and better infinity crops.\n    <br><br>\n    The crops in the infinity field can give a small production boost to the basic field, which can add up to a better boost if the whole infinity field is filled.\n    <br><br>\n    Unlike the ethereal field, the infinity field is more focused on growing and improving itself slowly over time with its own resource, rather than merely boosting the basic field.\n    <br><br>\n    The first crop, a brassica, is not a permanent crop (similar to brassica in basic field, but without the copying ability and longer lifespan), and will need to be planted multiple times to collect enough infinity seeds for better crops. After that, permanent crops will unlock too.\n    ",Sh,
void 0,[[$c[0],$c[0],$c[0]],[$c[0],Th,$c[0]],[$c[0],$c[0],$c[0]]]);
cM(43,"Infinity pond fishes","You unlocked fishes in the infinity pond!","You unlocked fishes in the infinity pond!\n    <br><br>\n    Fishes cost infinity spores to place. They can be accessed by clicking the pond in the infinity field, then placing fishes on cells of the pond.\n    <br><br>\n    Fishes upgrade the infinity field in various ways. The location of fishes in the pond does not matter.\n    ",Yd,void 0,[[bd[0],bd[1],bd[0]],[bd[1],bd[2],Jc(bd[3],Yd)],[Jc(bd[3],$d),bd[1],bd[0]]]);
function dM(){var a=Ha({Da:!0,title:"Shortcuts"});var b="<b>List of keyboard/mobile shortcuts:</b><br/><br/>";tr()||(b+="More shortcuts will appear in this list later as you progress through the game.<br/><br/>");b+='<b>Mobile shortcuts:</b><br/><br/> \u2022 on mobile/touch devices, you can long-press most icons/buttons to access the shift and ctrl variants (e.g. the pause button and refresh watercress button).<br/> \u2022 on mobile/touch devices, you can also long-press to see tooltips, e.g on most buttons in the setting dialogs.<br/> \u2022 NOTE: mobile browsers don\'t show scrollbars so you can\'t always see if something is scrollable. The game shows a shadow effect to show scrollable content but this may be subtle. E.g. in the (detailed) stats dialogs of some plants in the field.<br/><br/><b>Main shortcuts:</b><br/> \u2022 <i>Note</i>: on mac, ctrl means command instead.<br/> \u2022 <b>esc</b>: close current dialog. If no dialogs are open, shows main menu.<br/> \u2022 <b>"p"</b>: when crop in field under mouse cursor: pick (=remember) this crop for planting. When empty field mouse cursor: plant the remembered crop here (no mouse click required)<br/> \u2022 <b>"shift+p"</b>: similar to p, but always plants, so replaces crop if there is an existing one below the mouse cursor.<br/> \u2022 <b>"d"</b>: delete crop under mouse cursor (no mouse click required)<br/> \u2022 <b>"shift+d"</b>: downgrade tier of crop under mouse cursor, that is keep same type of crop but replace it with the crop that is one tier lower, especially handy in ethereal field (no mouse click required)<br/> \u2022 <b>"u"</b>: upgrade tier: replace crop or template under mouse cursor with highest available tier of the same type that you can afford (no mouse click required)<br/> \u2022 <b>shift + click empty field</b>: plant last planted or unlocked crop type.<br/> \u2022 <b>ctrl + click empty field</b>: plant a watercress (does not affect last planted type for shift key).<br/> \u2022 <b>ctrl + click non-empty field</b>: delete crop.<br/> \u2022 <b>shift + click non-empty field</b>: replace crop.<br/> \u2022 <b>ctrl + shift + click field</b>: upgrade tier: replace crop or template with highest unlocked tier (if enabled in preferences), pick this crop type as last planted, and on empty field, plant highest tier of picked crop type you can afford.<br/> \u2022 <b>"w"</b>: replant watercress on all field tiles that have a watercress remainder, and refresh existing ones. Such a remainder appears for watercress that have been copying from multiple plants, that is, a good copying spot. Copying has diminishing returns if there are multiple watercress anywhere on the map, 1 or 2 is effective (check the seeds/s income to view the effect).<br/> \u2022 <b>"t"</b>: show transcend dialog (if available)<br/> \u2022 <b>"f"</b>: go to the basic field tab<br/> \u2022 <b>"e"</b>: go to the ethereal field tab (if available)<br/> \u2022 <b>"i"</b>: go to the infinity field tab (if available)<br/> \u2022 <b>"ctrl + z"</b>: undo / redo<br/> \u2022 <b>], }, ) or ></b>: select next active fruit. Can be changed in the preferences under "controls" to instead select next game tab.<br/> \u2022 <b>[, {, ( or <</b>: select previous active fruit. Can be changed in the preferences under "controls" to instead select previous game tab.<br/> \u2022 <b>number keys "1-9"</b>: by default, select fruit slot (when available). Can be changed in the preferences under "controls" to instead activate weather, change game tabs or do auto-actions.<br/> \u2022 <b>"shift" + number keys "1-9"</b>: by default, activate weather (1-3). Can be changed in the preferences under "controls" to instead select fruit slots, change game tabs or do auto-actions.<br/>';
0<E.Vc&&(b+="<br/><b>Fruits tab:</b><br/><br/> \u2022 <b>ctrl + click fruit</b>: move fruit between sacrificial and storage slots, if possible.<br/> \u2022 <b>shift + click fruit</b>: same as ctrl + click fruit.<br/> \u2022 <b>shift + click fruit ability upgrade</b>: buy multiple abilities up to 25% of currently available essence.<br/>");tr()&&(b+='<br/><b>Blueprints:</b><br/><br/> \u2022 <b>"b"</b>: open the blueprint library, when available.<br/> \u2022 <b>"t" followed by "b"</b>: transcend and open the transcend-with-blueprint dialog.<br/> \u2022 <b>"t" followed by "Enter"</b>: transcend without blueprint.<br/> \u2022 <b>"t" followed by "c"</b>: transcend and open the start-new-challenge dialog.<br/> \u2022 <b>number keys "1-9" in blueprint selection dialog</b>: open or use this blueprint<br/> \u2022 <b>"shift" + number keys "1-9" in blueprint selection dialog</b>: plant this blueprint (overriding)<br/> \u2022 <b>"p" in blueprint selection dialog</b>: toggle page 1 / page 2<br/> \u2022 <b>shift + click blueprint</b>: immediately plant this blueprint, rather than opening its edit screen.<br/> \u2022 <b>shift + click blueprint "To Field"</b>: plant this blueprint, but let it override non-matching crops. Without shift, it only plants on empty field spots.<br/> \u2022 <b>shift + click squirrel upgrade</b>: when you unlocked this type of upgrades and have respecced at least once: upgrade all upgrades until this one, only available if you can afford it and this upgrade was seen before.<br/> \u2022 <b>"f" in blueprint editing dialog</b>: set blueprint from field.<br/> \u2022 <b>"enter" in blueprint editing dialog</b>: plant blueprint (overriding).<br/>');
a.content.a.innerHTML=b+"<br/><b>Special button actions:</b><br/><br/> \u2022 <b>shift + click upgrade</b>: buy as many of this upgrade as you can afford.<br/> \u2022 <b>shift + click undo</b>: save the undo state now, rather than load it. This overwrites your undo so eliminates any chance of undoing now. This will also be overwritten again if you do actions a minute later.<br/> \u2022 <b>shift + click save import dialog</b>: import and old savegame, but force paused state, do not run the time, so you get the resources and season at the time of saving rather than with all production during that time added.<br/> \u2022 <b>ctrl + click save import dialog</b>: import and old savegame, but force non-paused state, even if the savegame was saved while paused, this will cause all time between saving and now to be ran.<br/><br/><br/>"}
